const HeaderAuth = () => {
    return (
      <div className="HeaderContainer">
        <div className="ButtonContainer">
          <i class="fa-arrow-left icon"></i>
          <button className="backButton">Retour</button>
        </div>
        <span className="Help">Help</span>
      </div>
    );
}
export default HeaderAuth;
